import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props); 

    this.equation = "";
  }

  click(operation) {
    this.equation += operation;
    console.log(this.equation);
  }

  clear() {
    this.equation = "";
    console.log(this.equation);
  }
  render() {
    return (
      <div className="App">
        <div className="row"> 
          <img src={process.env.PUBLIC_URL + '/images/1title.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/2factorial.gif'} onClick={() => this.click("!")}/>
          <img src={process.env.PUBLIC_URL + '/images/3openbracket.gif'} onClick={() => this.click("(")}/>
          <img src={process.env.PUBLIC_URL + '/images/4closingbracket.gif'} onClick={() => this.click(")")}/>
          <img src={process.env.PUBLIC_URL + '/images/5modulo.gif'} onClick={() => this.click("%")}/>
          <img src={process.env.PUBLIC_URL + '/images/6AC.gif' } onClick={() => this.clear()}/>
        </div>
        <div className="row"> 
          <img src={process.env.PUBLIC_URL + '/images/7lnv.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/8sin.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/9ln.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/101.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/113.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/125.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/13:.gif.gif'}/>
        </div>
        <div className="row"> 
          <img src={process.env.PUBLIC_URL + '/images/14pi.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/15cos.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/16log.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/177.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/189.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/190.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/20x.gif'}/>
        </div>
        <div className="row"> 
          <img src={process.env.PUBLIC_URL + '/images/21e.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/22tan.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/23sqrt.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/242.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/254.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/266.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/27-.gif'}/>
        </div>
        <div className="row"> 
          <img src={process.env.PUBLIC_URL + '/images/28ans.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/29exp.png'}/>
          <img src={process.env.PUBLIC_URL + '/images/30^.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/318.gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/32..gif'}/>
          <img src={process.env.PUBLIC_URL + '/images/33=.png'}/>
          <img src={process.env.PUBLIC_URL + '/images/34+.gif'}/>
        </div>
      </div>
    );
  }
}

export default App;
